import './App.css';
import URL from './components/Url';
import Input from './components/input';
import Button from './components/outbutton';
import Output from './components/output';

function App() {
  const style = {
    backgroundColor: "#190482",
    height: '100%',
    color: "#C2D9FF",
    padding: "5em",
    backgroundSize: 'cover',
    clipPath: 'polygon(0 0, 100% 0, 100% 100%, 0 100%)', // Triangle shape
  };

  return (
    <div style={style}>
      <div>
        <URL />
        <Input />
        <Button />
      </div>
      <div>
        <Output />
      </div>
    </div>
  );
}

export default App;
